description:
Feeling a little tense? Then do yourself a favor and experience the charms of Vouyer Media's Massage Parlor Mayhem, the latest release from 2011 AVN and XBIZ award nominated director Zander. Capri Cavelli, Vicki Chase, Nicole Aniston, Brandy Aniston, Chloe Jones and Riley Jensen are the trained therapists perfecting their art for a host of lucky patients. Using a variety of sexy techniques to give their men 'release,' they go above and beyond the call of duty in spirited sessions with Ramon Nomar, Bill Bailey, Anthony Rosano and Mark Ashley. It's full service physical therapy that always delivers a happy ending!

